// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Profile {

    struct Bio {
        address userAddress;
        string firstName;
        string middleName;
        string lastName;
        string email;
        string phone;
        string profileImage;
        uint256 createDate;
        // string[] frontend;
        // string[] backend;
        // string[] framework;
        Skill[] skill;
    }
    mapping (address => Bio) public  profile;

    struct Skill {
        string[] frontend;
        string[] backend;
        string[] framework;
    }
    
    // "FTim", "MTim", "LTim", "ETim", "PTim", "ITim", ["vue", "react"], ["python", "php", "js"], ["nodejs", "nuxt", "next"]
    function addBio(string memory firstName, string memory middleName, string memory lastName, string memory email, string memory phone, string memory profileImage, string[] memory frontend, string[] memory backend, string[] memory framework) public {
        profile[msg.sender].firstName = firstName;
        profile[msg.sender].middleName = middleName;
        profile[msg.sender].lastName = lastName;
        profile[msg.sender].email = email;
        profile[msg.sender].phone = phone;
        profile[msg.sender].profileImage = profileImage;
        profile[msg.sender].userAddress = msg.sender; 
        profile[msg.sender].createDate = block.timestamp;
        profile[msg.sender].skill[0].frontend = frontend;

        // addSkill(frontend, 0);
        // addSkill(backend, 1);
        // addSkill(framework, 2);
    }

    // function addSkill(string[] memory _frontend, uint8 _type) private {
    //     // add skill frontend
    //     if(_type == 0){
    //         for(uint8 i=0; i < _frontend.length; i++) {
    //             profile[msg.sender].frontend.push(_frontend[i]);
    //         }
    //     }
    //     // add skill backtend
    //     if(_type == 1){
    //         for(uint8 i=0; i < _frontend.length; i++) {
    //             profile[msg.sender].backend.push(_frontend[i]);
    //         }
    //     }
    //     // add skill framework
    //     if(_type == 2){
    //         for(uint8 i=0; i < _frontend.length; i++) {
    //             profile[msg.sender].framework.push(_frontend[i]);
    //         }
    //     }
    // }

    // function getAllSkill() external view returns( Bio memory) {
    //     return profile[msg.sender];
    // }

    function delProfile() public {
        delete profile[msg.sender];
    }


}

